import React from 'react';
import '../css/Map.css';

import rd3 from 'react-d3-library';
import node from 'mapExec';
const RD3Component = rd3.Component;

class Map extends React.Component {

    constructor(props) {
        super(props);
        this.state = {d3: ''}
    }

    componentDidMount() {
        this.setState({d3: node});
    }

    render() {
        return (
            <div>
                <RD3Component data={this.state.d3} />
            </div>
        )
    }
}

export default Map;
